pragma solidity ^0.8.7;

import { ILiFi } from "../Interfaces/ILiFi.sol";
import { LibAsset } from "../Libraries/LibAsset.sol";
import { LibLiFi } from "../Libraries/LibLiFi.sol";

contract HopFacet is ILiFi {
    function startBridgeTokensViaHop(LiFiData memory _lifiData) public payable {
        // Do HOP stuff

        emit LiFiTransferStarted(
            _lifiData.transactionId,
            _lifiData.integrator,
            _lifiData.referrer,
            _lifiData.fromAssetId,
            _lifiData.fromAmount,
            _lifiData.timestamp
        );
    }

    function swapAndStartBridgeTokensViaHop(LiFiData memory _lifiData, LibLiFi.SwapData[] calldata _swapData)
        public
        payable
    {
        // Do Hop stuff

        // Swap
        uint256 fromAmount = _lifiData.fromAmount;
        uint256 resultingBalance = 0;
        for (uint8 i; i < _swapData.length; i++) {
            resultingBalance = LibAsset.getOwnBalance(_swapData[i].toAssetId);
            LibLiFi.swap(fromAmount, _swapData[i]);
            resultingBalance = LibAsset.getOwnBalance(_swapData[i].toAssetId) - resultingBalance;
            fromAmount = resultingBalance;
        }

        emit LiFiTransferStarted(
            _lifiData.transactionId,
            _lifiData.integrator,
            _lifiData.referrer,
            _lifiData.fromAssetId,
            _lifiData.fromAmount,
            _lifiData.timestamp
        );
    }
}
