pragma solidity ^0.8.7;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import { LibAsset } from "./LibAsset.sol";

library LibLiFi {
    struct SwapData {
        address callTo;
        address fromAssetId;
        address toAssetId;
        bytes callData;
    }

    event AssetSwapped(address fromAssetId, address toAssetId, uint256 fromAmount, uint256 toAmount);

    function swap(uint256 fromAmount, SwapData calldata _swapData) internal {
        uint256 toAmount = LibAsset.getOwnBalance(_swapData.toAssetId);
        address fromAssetId = _swapData.fromAssetId;
        if (!LibAsset.isNativeAsset(fromAssetId) && LibAsset.getOwnBalance(fromAssetId) != fromAmount) {
            LibAsset.transferFromERC20(_swapData.fromAssetId, msg.sender, address(this), fromAmount);
        }

        LibAsset.approveERC20(IERC20(fromAssetId), _swapData.callTo, fromAmount);
        (bool success, ) = _swapData.callTo.call{ value: msg.value }(_swapData.callData);
        require(success, "ERR_DEX_SWAP_FAILED");

        toAmount = LibAsset.getOwnBalance(_swapData.toAssetId) - toAmount;
        emit AssetSwapped(_swapData.fromAssetId, _swapData.toAssetId, fromAmount, toAmount);
    }
}
